import React, { Component } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

class MapContainer extends Component {
    constructor(props) {
        super(props);

        this.state = {
        }
    }

    displayMarkers = () => {
        return this.state.stores.map((store, index) => {
            return <Marker key={index} id={index} position={{
                lat: store.latitude,
                lng: store.longitude
            }}
                           onClick={() => console.log("You clicked me!")} />
        })
    }



    render() {
        const mapStyles = {
            width: '100%',
            height: '100%',
        };
        return (
            <script async defer
                    src="https://maps.googleapis.com/maps/api/js?client=296502506784-uu56g8b6curecr5iuqrfkil9fq28f510.apps.googleusercontent.com&v=quarterly&callback=initMap"></script>
        );
    }
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyD29pS-vR2ecnzC5wCLdE6Bx3kxMEgL4aU'
})(MapContainer);
